import logo from '../images/logo.svg';
import '../App.css';
import './Contact.css';

export default function Contact() {
  return (
    <div className="App">
      <header className="container">
        <div className="contactBox App-header">
          <p className="intro">Do you want to talk with me? Email to cathyseo.d@gmail.com or leave your message here.</p>
          <img src={logo}></img>
        </div>
    </header>
    </div>
  );
}
